Beautiful Planet Series 1

Travel Documentary hosted by Jane Frost, published by Cascade in 2011 - English narration


Information
------------------------------

Beautiful Planet Series 1
Beautiful Planet Series 1 is a documentary series on 10 discs. In sections, each approximately 50-60 minutes Embark on an unforgettable journey all over the globe through in this spectacular guided tour to the world's most marvellous sights and places. Capturing the nature and culture of these exotic destinations, this lusciously filmed documentary series offers a vivid and entertaining portrait of the history and significance of distance cities and countries. Shot in dazzling high definition; prepare to be whisked away to one thrilling attraction after another across our most Beautiful Planet.



6)  Morocco 
Disc 6 starts with a visit to Morocco Marrakech. Major tourist attractions and the typical bazaars characterize the cityscape. Then when you go on to the Ksar of Morocco. The traditional rural settlements reflect the life of the Berbers of North Africa.



